"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def Pharm_Icon(name):
    global IMAGES

    _barray = QByteArray()
    _barray_data = _barray.fromBase64(IMAGES[name].encode("utf-8"))

    #create pixmap from base64 data
    _pixmap = QPixmap ()
    _pixmap.loadFromData(_barray_data, "PNG")

    #create icon
    _icon  = QIcon()
    _icon.addPixmap(_pixmap)

    return _icon

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def Pharm_Pixmap(name):
    global IMAGES

    _barray = QByteArray()
    _barray_data = _barray.fromBase64(IMAGES[name].encode("utf-8"))

    #create pixmap from base64 data
    _pixmap = QPixmap ()
    _pixmap.loadFromData(_barray_data, "PNG")

    return _pixmap


